script: |
  super -f tsv -I q32.sql | sort > q32.out

vector: true

inputs:
  - name: q32.sql
    data: |
      SELECT ALL COALESCE ( 4, - 3 / 67 / - 36 + - COALESCE ( + + 48, 86 * + + 21 / + - CAST ( - CAST ( NULL AS INTEGER ) AS INTEGER ) ) * + MIN ( + 23 ) );

outputs:
  - name: q32.out
    data: |
      4
